    if (!Number.isInteger(val)) throw new TypeError('length must be a number');
    this._length = val;
  }

  get students() {
    return this._students;
  }

  set students(val) {
    if (!Array.isArray(val)) throw new TypeError('students type must be an Array');
    this._students = val;
  }
}
